var $bm_rt;
var isReversed, calibrate, isEnabled, veloc;
isReversed = effect('\u56de\u8ee2')('Pseudo/yrO224f4b207o-0002');
calibrate = effect('\u56de\u8ee2')('Pseudo/yrO224f4b207o-0004');
$bm_rt = isEnabled = effect('\u56de\u8ee2')('Pseudo/yrO224f4b207o-0001');
if (isEnabled == 1) {
    $bm_rt = veloc = effect('\u56de\u8ee2')('Pseudo/yrO224f4b207o-0005');
    if (isReversed == 1) {
        $bm_rt = value = $bm_sum($bm_sum($bm_transform.rotation, $bm_mul($bm_sub(time, inPoint), veloc)), calibrate);
    } else {
        $bm_rt = value = $bm_mul($bm_sum($bm_sum($bm_transform.rotation, $bm_mul($bm_sub(time, inPoint), veloc)), calibrate), -1);
    }
} else {
    $bm_rt = value = $bm_transform.rotation;
}

